import { Button, Result } from "antd";

const Success = () => {
  return (
    <Result
      status="success"
      title="Successfully Purchased Property"
      subTitle="Order number: 2017182818828182881."
      extra={[
        <Button type="primary" key="console">
          Go To Results
        </Button>,
        <Button key="buy">Buy Another Property</Button>,
      ]}
    />
  );
};

export default Success;
